import React from "react";
import { GoogleMap, withScriptjs, withGoogleMap } from "react-google-maps";

const GoogleMaps = () => {
  return (
    <withScriptjs>
      <withGoogleMap>
        <GoogleMap defaultZoom={10} defaultCenter={{ lat: 12, lng: 12 }} />
      </withGoogleMap>
    </withScriptjs>
  );
};

export default GoogleMaps;
